import React from "react";
import { ReactComponent as Logo } from "./figure.svg";

export default function Website() {
  const styleTitle1 = {
    fontSize: 72,
    textAlign: "right",
    paddingTop: "100px",
    paddingRight: "800px",
    bold: { fontWeight: "bold" },
  };
  const styleTitle2 = {
    fontSize: 72,
    textAlign: "right",
    paddingTop: "0px",
    paddingRight: "800px",
    bold: { fontWeight: "bold" },
    italic: { fontStyle: "italic" },
    underline: { textDecorationLine: "underline" },
  };
  const B = (props) => (
    <Text style={{ fontWeight: "bold" }}>{props.children}</Text>
  );

  const centering = {
    textAlign: "center",
  };

  return (
    <div style={centering}>
      <h1 style={styleTitle1}>
        <B>Lecture Videos...</B>
      </h1>
      <h1 style={styleTitle2}>Summarized.</h1>
      <Logo />
      <h3>
        Speed-running recorded lectures not good enough for you? Get a clean,
        readable summary of it instead!
      </h3>
      <button className="btn m-4 btn-primary btn-lg">Upload</button>
      <p>X minutes of videos uploaded!</p>
      <p>X minutes of words removed!</p>
      <p>X% summary satisfaction rate!</p>
    </div>
  );
}
